import { useState, useEffect } from "react";
import "./App.css";

function App() {
  const [isLoading, setIsLoading] = useState(true);
  const [coins, setCoins] = useState([]);

  return (
    <div>
      <h1>The Coins!</h1>
      {isLoading ? <div>Loading...</div> : null}
    </div>
  );
}

export default App;
